import "./App.css";
import * as React from "react";
import HomePage from "./paginas/informacao.js"
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={HomePage} />
      </Switch>
    </Router>
  );
}



export default App;
